import React, { useEffect, useState } from 'react';
import { useParams, Link, useNavigate } from 'react-router-dom';
import { API_BASE_URL } from '../Config';

export default function InvestmentsDetails() {
    const { id } = useParams();
    const navigate = useNavigate();
    const [inv, setInv] = useState(null);
    const [error, setError] = useState(null);

    const fmtDate = (iso) => {
        if (!iso) return '-';
        const d = new Date(iso);
        return isNaN(d.getTime())
            ? iso
            : new Intl.DateTimeFormat('pt-BR', { dateStyle: 'short', timeStyle: 'short' }).format(d);
    };

    const fmtMoney = (n) =>
        typeof n === 'number'
            ? new Intl.NumberFormat('pt-BR', { style: 'currency', currency: 'BRL' }).format(n)
            : (n != null && !isNaN(+n) ? new Intl.NumberFormat('pt-BR', { style: 'currency', currency: 'BRL' }).format(+n) : '-');

    useEffect(() => {
        if (!id) {
            setError('ID não informado.');
            return;
        }

        // 1ª tentativa: GET /investments/{id} (se existir no backend)
        fetch(`${API_BASE_URL}/investments/${id}`)
            .then((res) => {
                if (res.ok) return res.json();
                // Fallback: buscar a lista e filtrar localmente
                throw new Error('fallback');
            })
            .then((data) => setInv(data))
            .catch(() => {
                fetch(`${API_BASE_URL}/investments`)
                    .then((res) => {
                        if (!res.ok) throw new Error('Falha ao buscar investimentos');
                        return res.json();
                    })
                    .then((list) => {
                        const arr = Array.isArray(list) ? list : (list && list.content ? list.content : []);
                        const found = arr.find((x) => x.id === id);
                        if (!found) throw new Error('Investimento não encontrado');
                        setInv(found);
                    })
                    .catch((err) => setError(err.message || 'Erro ao carregar investimento'));
            });
    }, [id]);

    const handleDelete = async () => {
        if (!window.confirm('Confirma a exclusão deste investimento?')) return;
        try {
            const res = await fetch(`${API_BASE_URL}/investments/remove`, {
                method: 'DELETE',
                headers: { 'Content-Type': 'application/json' },
                body: JSON.stringify({ id }),
            });
            if (!res.ok) {
                const txt = await res.text();
                throw new Error(txt || 'Erro ao excluir investimento');
            }
            navigate('/investments');
        } catch (e) {
            alert(e.message || 'Erro ao excluir');
        }
    };

    if (error) return <p>Erro: {error}</p>;
    if (!inv) return <p>Carregando...</p>;

    const user = inv.user || {};

    return (
        <div>
            <h1>Detalhes do Investimento</h1>

            <p><strong>ID:</strong> {inv.id}</p>
            <p><strong>Usuário:</strong> {user.name || '-'} {user.email ? `(${user.email})` : ''}</p>
            <p><strong>Tipo:</strong> {inv.type || '-'}</p>
            <p><strong>Status:</strong> {inv.status || '-'}</p>
            <p><strong>Símbolo:</strong> {inv.symbol || '-'}</p>
            <p><strong>Quantidade:</strong> {typeof inv.quantity === 'number' ? inv.quantity : '-'}</p>
            <p><strong>Preço de Compra:</strong> {fmtMoney(inv.purchasePrice)}</p>
            <p><strong>Data da Compra:</strong> {fmtDate(inv.purchaseDate)}</p>

            <div className="mt-3">
                <button className="btn btn-danger me-2" onClick={handleDelete}>
                    Excluir
                </button>
                <Link to="/investments" className="btn btn-secondary">Voltar</Link>
            </div>
        </div>
    );
}
